<style type="text/css" id="custom-design-rules-style" data-design="{&quot;bg_image_id&quot;:null,&quot;body_color&quot;:&quot;474747&quot;,&quot;hd_ft_color&quot;:&quot;333333&quot;,&quot;bg_file_name&quot;:null,&quot;navbar_bg_color&quot;:&quot;474747&quot;,&quot;bg_fixed&quot;:null,&quot;invert_iconography&quot;:1,&quot;bg_behavior&quot;:&quot;r&quot;,&quot;text_color&quot;:&quot;D6D6D6&quot;,&quot;tile_bg&quot;:null,&quot;defaultbg&quot;:false,&quot;secondary_text_color&quot;:&quot;D6D6D6&quot;,&quot;bg_halign&quot;:&quot;l&quot;,&quot;link_color&quot;:&quot;000000&quot;,&quot;bg_color&quot;:&quot;000000&quot;}">

    #propOpenWrapper {
        background: #474747;
    }

    #pgBd {
        background: #474747;
        color: #D6D6D6;
    }

    a.custom-color, .custom-link-color, #trackInfo a:not(.notSkinnable), #trackInfo .buy-link, #tagArea a, #rightColumn a, #name-section a, #indexpage a, .editable-grid a, .featured-grid a, #band-navbar a, #merch-item p a, #merch-item .buy a, #merch-item .buy button, #merch-item .more-merch a, .share-collect-controls a, .share-collect-controls button, .follow-unfollow, .follow-unfollow div, .collected-by a, .subscribe a, .sub a, .video-list a, .sub .main a, .subwelcome a, .artists-grid-name a, .featured-grid-name, .label-welcome .buttons a.new, .themed .label-band-selector a.themeable, .tralbum-tags a  {
        color: #000000;
    }

    .themed .label-band-selector .bands-menu {
        border: 1px solid #000000;
    }

    .themed .label-band-selector .bands-menu,
    .themed .label-band-selector .bands-menu .menu-artistpic {
         background: #474747;
    }

    .label-welcome h2, .label-welcome p {
        color: #D6D6D6;
    }

    .label-welcome .buttons a.new {
        box-shadow: 2px 2px #000000;
    }

    .label-welcome .buttons a.existing {
        box-shadow: 2px 2px #D6D6D6;
    }

    .primaryText,
    #discography a.primaryText,
    #trackInfo a.title_link,
    .label-welcome .buttons a.existing {
        color: #D6D6D6;
    }

    .secondaryText {
        color: #D6D6D6;
    }

    #band-navbar a:hover {
        border-color: #000000;
    }

    #band-navbar a.active {
        color: #D6D6D6;
        border-color: #D6D6D6;
    }

    .themed .label-band-selector .label {
        color: #D6D6D6;
    }

    .themed .label-band-selector .tabs > li {
        border-color: #D6D6D6;
    }

    .themed .label-band-selector a.selected {
        color: #D6D6D6;
    }

    .themed .label-band-selector .caret {
        fill: #000000;
    }

    .themed .label-band-selector .selected .caret {
        fill: #D6D6D6;
    }

    #trackInfo a.notable {
        color: red; /* overrides above */
    }

    
    #band-navbar {
        background-color: #474747;
    }
    

    body {
        background: #000000;
        
            background-position: left top;
            background-repeat: repeat;
        
        background-image: none;
        
    }

    
    
        body.has-menubar {
            background-position: left 53px;
        }
        body.has-top-banner {
            background-position: left 40px;
        }
        body.has-menubar.has-top-banner {
            background-position: left 88px;
        }
        
        body.has-corpbanner2 {
            background-position: left calc(48px - 1px);
        }
        body.has-menubar.has-corpbanner2 {
            background-position: left calc(53px + 48px - 1px);
        }
    

    #pgHd, .lang-picker-content {
        background-color: #333333;
    }

    .just-icon {
        color: #474747;
    }

    .just-icon-bg {
        border-right-color: #D6D6D6;
    }

    .collected-by .ellipsis-text {
        color: #000000;
    }
    .collected-by .ellipsis-bg {
        background-color: #000000;
    }

    button.subtop,
    button.subbot,
    button.custom-color {
        background: #000000;
        color: #474747;
    }

    .sub .includeditems .item a {
        color: #D6D6D6;
    }

    .sub .post-message-link {
        background-color: rgba(0, 0, 0, 0.2);
        color: #000000;
    }

    .sub ul.tierslist li.tier {
        border-color: rgba(0, 0, 0, 0.2);
    }

    .sub button.tierbutton .spacer {
        background-color: #474747;
    }

    ol.sub-navbar li.active,
    .invertIconography ol.sub-navbar li.active {
        background-color: #474747;
    }

    ol.sub-navbar a {
        color: #000000;
    }

    .post-subscribe .button-background {
        background-color: rgba(0, 0, 0, 0.2);
        color: #000000;
    }

